import "./App.css";
import MainPageComponent from "./main/index.js";
import { Switch, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/">
          <MainPageComponent />
        </Route>
        <Route path="/selfie"></Route>
      </Switch>
    </div>
  );
}

export default App;
